import React from 'react';
import './style.css'
const App = () => {
  return (
    <div className="App-header">
      <nav>
        <ul className="navbar-list">
          <li><a href="/python" className="navbar-item">Python</a></li>
          <li><a href="/docker" className="navbar-item">Docker</a></li>
          <li><a href="/java" className="navbar-item">Java</a></li>
          <li><a href="/javascript" className="navbar-item">JavaScript</a></li>
          <li><a href="/mongo" className="navbar-item">MongoDB</a></li>
          <li><a href="/sql" className="navbar-item">SQL</a></li>
          <li><a href="/react" className="navbar-item">React</a></li>
        </ul>
      </nav>
      <div className="homepage-content">
        <h1 className="homepage-title">Welcome to the Courses Page!</h1>
        <p className="homepage-description">Please choose a course from the navigation bar above to learn more.</p>
      </div>
    </div>
  );
};

export default App;
